import React from 'react';

const DogContainer = ({ dogs, selectedDogId, selectedDog }) => {
    return (
        dogs.map(dog => <span key={dog.id} selectedDogId={dog.id} onClick={selectedDog}>{dog.name}</span>)
    )
}

export default DogContainer
